import React from 'react';
import fetchCambio from '../fetch/fetchCambio';

class Wallet extends React.Component {
  constructor() {
    super();
    this.state = {
      cambios: [],
    };

    this.catchCambio = this.catchCambio.bind(this);
  }

  async componentDidMount() {
    await this.catchCambio();
  }

  async catchCambio() {
    const cambi = await fetchCambio();
    this.setState({
      cambios: cambi,
    });
  }

  render() {
    const { cambios } = this.state;
    return ( <div>TrybeWallet</div>)
  }
}

export default Wallet;
